from math import sin, asin, log, pi, exp

def lngToPixel(lng, zoom):
    return (lng + 180) * (256 << zoom) / 360

def pixelToLng(pixelX, zoom):
    return pixelX * 360 / (256 << zoom) - 180

def latToPixel(lat, zoom):
    siny = sin(lat * pi / 180)
    y = log((1 + siny) / (1 - siny))
    return (128 << zoom) * (1 - y / (2 * pi))

def pixelToLat(pixelY, zoom):
    y = 2 * pi * (1 - pixelY / (128 << zoom))
    z = exp(y)
    siny = (z - 1) / (z + 1)
    return asin(siny) * 180 / pi

def earth_to_mars(earth):
    lat, lng = earth
    
    idx = int(lat * 10 + 0.5) * 10000 + int(lng * 10 + 0.5)
    if (MARS_DATA.has_key(idx)):
        fix = MARS_DATA[idx]
        lngf = (fix % 10000) - 2000
        latf = int(fix / 10000) - 2000
    
        latpix = latToPixel(lat, 18)
        lngpix = lngToPixel(lng, 18)

        lngpix += lngf
        latpix += latf
        
        lat = pixelToLat(latpix, 18)
        lng = pixelToLng(lngpix, 18)

    return (lat, lng)

def mars_to_earth(mars):
    lat, lng = mars

    idx = int(lat * 10 + 0.5) * 10000 + int(lng * 10 + 0.5)
    if (MARS_DATA.has_key(idx)):
        fix = MARS_DATA[idx]
        lngf = (fix % 10000) - 2000
        latf = int(fix / 10000) - 2000
    
        latpix = latToPixel(lat, 18)
        lngpix = lngToPixel(lng, 18)

        lngpix -= lngf
        latpix -= latf
        
        lat = pixelToLat(latpix, 18)
        lng = pixelToLng(lngpix, 18)

    return (lat, lng)

def is_on_prc(coordinates):
    lat, lng = coordinates
    idx = int(lat * 10 + 0.5) * 10000 + int(lng * 10 + 0.5)
    return MARS_DATA.has_key(idx)

